import React from 'react';
import Player from './Player';

const Emojis = props => {
  const data = this.props.info;
  let content;

  if (data === null) {
    content = 'loading';
  } else {
    content = (
      <div className="row">
        <Player status="0" name="Alfredo" />
        <Player status="0" name="Andrea" />
        <Player status="0" name="Jackeline" />
        <Player status="0" name="Juan" />
        <Player status="1" name="Manuel" />
        {/* <Player status="0" name="Luis" /> */}
      </div>
    );
  }
  return (
    <div className="col-6">
      <div className="double playlist">{content}</div>
    </div>
  );
};

export default Emojis;
